import React from 'react'
import './SidebarAdmin.css'
import {BusinessCenter, Collections, Home, ShowChart } from '@material-ui/icons';

export default function SidebarAdmin() {
    return (
        <section className="admin_sidebar">
            <p><Home/>Home</p>
            <p><ShowChart/>Analytics</p>
            <p><Collections/></p>
            <p><BusinessCenter/></p>

        </section>
    )
}
